# Test generated by RoostGPT for test roostTest-API using AI Type Open AI and AI Model gpt-4

config:
  target: "http://api.yourwebsite.com"
  phases:
    - duration: 60
      arrivalRate: 20

scenarios:
  - name: "Successful API request"
    flow:
      - get:
          url: "/vets"
          expect:
            - statusCode: 200
            - hasProperty: "vetList"

  - name: "API request with validation failure"
    flow:
      - post:
          url: "/vets"
          json:
            invalidField: "invalidData"
          headers:
            Content-Type: "application/json"  
          expect:
            - statusCode: 400
            - hasProperty: "errorMessage"

  - name: "API request with edge case"
    flow:
      - post:
          url: "/vets"
          json:
            name: "Dr. Test Vet"
            specialty: " Vet"
          headers:
            Content-Type: "application/json"
          expect:
            - statusCode: 200
